import React, { Component } from "react";
import Nav from "react-bootstrap/Nav";

class Navbar extends Component {
  constructor(props) {
    super(props);

    this.state = { hidden: false };

    this.showElement = this.showElement.bind(this);
  }

  showElement(e) {
    e.persist();
    console.log(e);
    /*if (this.state.hidden === false) {
      document.getElementsByClassName("education")[0].style.display = "none";

      this.setState({ hidden: true });
    } else {
      document.getElementsByClassName("education")[0].style.display = "block";

      this.setState({ hidden: false });
    }*/
  }

  render() {
    return (
      <Nav id="testt" justify variant="tabs" defaultActiveKey="background">
        <Nav.Item>
          <Nav.Link eventKey="background">BACKGROUND</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link id="test" eventKey="education" onClick={this.showElement}>
            EDUCATION
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="experience">EXPERIENCE</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="skills">SKILLS</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="apps">SOFTWARE</Nav.Link>
        </Nav.Item>
      </Nav>
    );
  }
}

export default Navbar;
